import axios from "axios";

class GetData extends React.Component {
    constructor() {
        super();
        this.state = {
            dataBook: []
        };
    }
    componentDidMount() {
        axios.get("http://localhost:1212/api/book")
            .then(res => {
                this.dataBook = res.data;
            });
    }

    render() {
        return (
            this.state.dataBook
        )
    }
}

export default GetData;
